import React from 'react';
import { LinkedIn, YouTube, Facebook } from '@material-ui/icons';

const Footer = () => {
    return (
        <div className="footer">
            <LinkedIn fontSize="50px" />
            <YouTube />
            <Facebook />
        </div>
    );
};

export default Footer;
